import React from "react";

const Havedonepro = (abc) => {
  return (
    <>
      <div className="hv-inner-child">
        <div id="hvd1" className="text">
          <strong>{abc.title}</strong>
          <p>
            We offer full scope of carport <br />
            administrations to vehicle proprietors in <br />
            tucson.
          </p>
        </div>
      </div>
    </>
  );
};
const Havedonepro2 = (abc) => {
  return (
    <>
      <div className="hv-inner-child">
        <div id="hvd1" className="text text2">
          <strong>{abc.title}</strong>
          <p>
            We offer full scope of carport <br />
            administrations to vehicle proprietors in <br />
            tucson.
          </p>
        </div>
      </div>
    </>
  );
};


export {Havedonepro}
